	public static EntityResponce linkagecreate(EntityRequest requestXsd) throws Exception {
        
		EntityResponce responseXsd = new EntityResponce();
		PropertiesReader pro = new PropertiesReader();
		try {
			
			BankLinkagePojo  nameCheckPojo = EjbLookUps.getBankLinkageRemote().entityNameAndBankCheck(requestXsd.getAuditeeName(), requestXsd.getBank());
			
			if(nameCheckPojo!= null) {
				
//				if(nameCheckPojo.getStatus().equals("PENDING") || nameCheckPojo.getStatus().equals("ACTIVE")) {
					System.out.println("bank already exsist");
					responseXsd.setError(true);
					responseXsd.setErrorCode("100103");
					responseXsd.setErrorDescription("Bank Linkage request already submitted for this bank");
					return responseXsd;
					
//				}
//				else {
//					System.out.println("bank deactivated");
//				}
			}
			
			
			
			DateFormat inputDateFormat = new SimpleDateFormat("dd-MM-yyyy HH:mm:ss");
			DateFormat outputDateFormat = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
            
			BankLinkagePojo pojo = new BankLinkagePojo();
            
			String linkageId = genLinkageId();
			
			pojo.setLinkageId(linkageId);
			pojo.setAuditeePan(requestXsd.getAuditeePan());
			pojo.setAuditeeName(requestXsd.getAuditeeName());
			pojo.setAuditeeRegNo(requestXsd.getAuditeeRegNo());
			pojo.setRequestorName(requestXsd.getRequestorName());
			pojo.setRequestorPan(requestXsd.getRequestorPan());
			pojo.setUserId(requestXsd.getUserId());
            
			if (requestXsd.getLinkageType().equals("OTP")) {
				pojo.setStatus("ACTIVE");
			
			} else if (requestXsd.getLinkageType().equals("MANUAL"))
				pojo.setStatus("PENDING");
				
			if(!ServiceUtils.isEmpty(requestXsd.getFromDate())) {
							Date date = inputDateFormat.parse(requestXsd.getFromDate());
				String outputDate = outputDateFormat.format(date);
				Date date3 = outputDateFormat.parse(outputDate);
           
				pojo.setFromDate(date3);
			}
			if(!ServiceUtils.isEmpty(requestXsd.getToDate())) {
            
				Date date = inputDateFormat.parse(requestXsd.getToDate());
				String outputDate = outputDateFormat.format(date);
				Date date3 = outputDateFormat.parse(outputDate);
                
				pojo.setToDate(date3);
			}
             
			if(!ServiceUtils.isEmpty(requestXsd.getStatusDate())) {
				
				Date date = inputDateFormat.parse(requestXsd.getStatusDate());
				String outputDate = outputDateFormat.format(date);
				Date date3 = outputDateFormat.parse(outputDate);
  
				pojo.setFromDate(date3);
			}
			pojo.setRemark(requestXsd.getRemark());
			pojo.setBank(requestXsd.getBank());
			pojo.setLinkageType(requestXsd.getLinkageType());
		
		
			String storePath = null;
			
//			baseFolder=/data/wildfly-26.1.3.Final/BCP/
//		    DomainURL=https://balcon.nesl.co.in/BCP
			
			if(!ServiceUtils.isEmpty(requestXsd.getSupportingDoc())) {

			String baseFolder = pro.getUrlProperty("baseFolder");
			String url = pro.getUrlProperty("DomainURL");

			SimpleDateFormat folderDate = new SimpleDateFormat("yyyy-MM-dd");
			String folderDateFormat = folderDate.format(new Date());
			
			String pathCreate = baseFolder+"Support_document/"+folderDateFormat;
			
			String path = pathCreate+ File.separator+linkageId+".pdf";
			
			System.out.println("path1--->"+path);

			String url1 = "/Support_document/"+folderDateFormat+ File.separator+linkageId+".pdf";
			
			File passportFolder=new File(pathCreate);
			if(!passportFolder.exists())
			{
				passportFolder.mkdirs();
			}
			
			 storePath = url +url1;
			
			System.out.println("storepath-->"+storePath);
			
			byte[] pdfData =  Base64.getDecoder().decode(requestXsd.getSupportingDoc());
			
			OutputStream out = new FileOutputStream(path);
			out.write(pdfData);
			out.close();
			
			
			
			pojo.setSupportingDoc(storePath);
			
			}
			
			
			EjbLookUps.getBankLinkageRemote().create(pojo);

			System.out.println("create----->>>>");
			
			
			
			responseXsd.setError(false);
			responseXsd.setErrorDescription("Bank Linkage Request Submitted Successfully");
			responseXsd.setPan(requestXsd.getPan());
			responseXsd.setName(requestXsd.getName());
			responseXsd.setMobile(requestXsd.getMobile());
			responseXsd.setEmail(requestXsd.getEmail());
			responseXsd.setPdfPath(storePath);
			
			return responseXsd;

		} catch (Exception e) {
			e.printStackTrace();
			responseXsd.setError(true);
			responseXsd.setErrorCode("100103");
			responseXsd.setErrorDescription("Exception occured while creating");
			return responseXsd;
		}
	}	
	
	
	public static String genLinkageId() {
		
		LocalDateTime now = LocalDateTime.now();

        String formattedDate = now.format(DateTimeFormatter.ofPattern("MMdd"));
        String formattedTime = now.format(DateTimeFormatter.ofPattern("HHmm"));

        int milliseconds = now.getNano() / 1_000_000; // Convert nanoseconds to milliseconds

     //   Random random = new Random();
     //   int randomNumber = random.nextInt(999);
     //+ String.format("%03d", randomNumber)
        
        String randomNumberWithDateTime = formattedDate + formattedTime + String.format("%03d", milliseconds) ;

        System.out.println("LinkageId :" + randomNumberWithDateTime);
        
        return randomNumberWithDateTime; 
	}

		
