	public static EntityResponce approveRejectbanklinkage(EntityRequest reqXSD) throws Exception {

		EntityResponce responseXsd = new EntityResponce();

		BankLinkagePojo pojoList = null;

		try {
			pojoList = EjbLookUps.getBankLinkageRemote().findById(reqXSD.getLinkageId());
			
			
			if (pojoList == null ) {

				responseXsd = new EntityResponce();
				responseXsd.setError(true);
				responseXsd.setErrorCode(Constants.ECSV0008);
				responseXsd.setErrorDescription(ErrorMessage.getErrorMessage(Constants.ECSV0008));
				return responseXsd;
			} else {


				BankLinkagePojo pojo = new BankLinkagePojo();

				if (reqXSD.getStatus().equals("ACTIVE")) {


					pojo.setLinkageId(reqXSD.getLinkageId());
					pojo.setStatus("ACTIVE");
					pojo.setRemark(reqXSD.getRemark());
					pojo.setStatusDate(new Date());
					
					
					EjbLookUps.getBankLinkageRemote().update(pojo);
					responseXsd.setError(false);
					responseXsd.setErrorCode(Constants.ECSV0017);
					responseXsd.setErrorDescription("Approved successfully");
					return responseXsd;
					
				} else if (reqXSD.getStatus().equals("REJECT"))

				{
					pojo.setLinkageId(reqXSD.getLinkageId());
					pojo.setStatus(reqXSD.getStatus());
					pojo.setRemark(reqXSD.getRemark());
					pojo.setStatusDate(new Date());
					
					EjbLookUps.getBankLinkageRemote().update(pojo);
					
					responseXsd.setError(false);
					responseXsd.setErrorCode(Constants.ECSV0019);
					responseXsd.setErrorDescription("Reject successfully");
					return responseXsd;
				}
				
				
				else if (reqXSD.getStatus().equals("HOLD"))
				{
					pojo.setLinkageId(reqXSD.getLinkageId());
					pojo.setStatus(reqXSD.getStatus());
					pojo.setRemark(reqXSD.getRemark());
					pojo.setStatusDate(new Date());
					
					
					EjbLookUps.getBankLinkageRemote().update(pojo);
					
					responseXsd.setError(false);
					responseXsd.setErrorCode(Constants.ECSV0020);
					responseXsd.setErrorDescription("Hold Successfully");
					return responseXsd;
				}
				

				else if (reqXSD.getStatus().equals("DEACTIVE"))
				{
					pojo.setLinkageId(reqXSD.getLinkageId());
					pojo.setStatus(reqXSD.getStatus());
					pojo.setRemark(reqXSD.getRemark());
					pojo.setStatusDate(new Date());
					
					EjbLookUps.getBankLinkageRemote().update(pojo);
					
					responseXsd.setError(false);
					responseXsd.setErrorCode(Constants.ECSV0018);
					responseXsd.setErrorDescription("Deactivate Successfully");
					return responseXsd;
				}
				
				else {
					responseXsd.setError(true);
					responseXsd.setErrorCode(Constants.ECSV0016);
					responseXsd.setErrorDescription("Invalid Status");
					return responseXsd;

				}
			}
		} catch (Exception e) {

			e.printStackTrace();
			responseXsd.setError(true);
			responseXsd.setErrorCode(Constants.ECSV0001);
			responseXsd.setErrorDescription(ErrorMessage.getErrorMessage(Constants.ECSV0001));
			return responseXsd;
		}
	}
	
	

